import "./App.css";

function App() {
  const expenses = [
    {
      title: "Car insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
  ];

  return (
    <div className="App">
      <h2>Hello World</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
